;(def sampler (doquery :pcascade which-reduction nil))
;(def samples (drop 5000 (take 50000 sampler)))

(def samples (->> (doquery :pcascade which-reduction nil :number-of-threads 500)
  				  (take 50000)
  				  (drop 5000)))

