;; @@
; we take the highest-probability sample as a MAP estimate
(def highest-weight (last (sort (map :log-weight  samples))))
(def highest-weight-sample (first (filter #(= highest-weight (:log-weight %)) samples)))
(def highest-weight-func-text (:func (:result highest-weight-sample)))
(def highest-weight-func (eval highest-weight-func-text))
(plot/compose (plot/list-plot (sort data)) 
              (plot/plot highest-weight-func [250 7000]))
highest-weight-func-text
